To manage the state of Tooltips globally using React Context, you can follow these steps:

1. **Create a Tooltip Context**: This context will hold the state and functions to manage the Tooltips.
2. **Create a Tooltip Provider**: This provider will wrap your application and provide the context to all Tooltip components.
3. **Update the Tooltip Component**: Modify the Tooltip component to use the context for managing its state.

Here's how you can implement it:

### Step 1: Create a Tooltip Context

Create a new file `TooltipContext.js`:

```jsx
import React, { createContext, useState, useContext } from 'react';

const TooltipContext = createContext();

export const TooltipProvider = ({ children }) => {
  const [activeTooltipId, setActiveTooltipId] = useState(null);

  const openTooltip = (id) => {
    setActiveTooltipId(id);
  };

  const closeTooltip = () => {
    setActiveTooltipId(null);
  };

  return (
    <TooltipContext.Provider value={{ activeTooltipId, openTooltip, closeTooltip }}>
      {children}
    </TooltipContext.Provider>
  );
};

export const useTooltip = () => {
  return useContext(TooltipContext);
};
```

